window.bookSummaryJSON = "<p>All Sevyn wanted was to finish law school and make her late grandmother proud. She was never the one to color outside the lines or go against the rules. When Sevyn is suddenly faced with past due bills and eviction, she becomes overwhelmed trying to stay above water. What she didn't expect was the offer to help her with all her troubles. The only problem is it goes against all her morals.</p> <p>Nasir is content in his relationship with his long-term girlfriend. The two of them have an understanding. Inviting another partner in the bedroom has never been an issueâ€”until now. When Sevyn joins the couple for one night of pleasure, Nasir instantly becomes attracted to the innocence surrounding her. Soon he begins to question his current relationship and finds it hard to stay away from Sevyn.</p> <p>While Sevyn tries to fight the brewing desire she has for Nasir, he embraces it. What neither of them counted on was a fatal encounter that could take the both of them out before they even begin.</p> <p><b>Contains mature themes.</b></p>"; 
